        <script>

            window.onload = function () {
                var now = new Date().getTime();
                var page_load_time = Math.trunc((now - performance.timing.navigationStart) / 10);
                //console.log("User-perceived page loading time: "  + page_load_time);
                document.getElementById("result").style.display = 'block';
                if ( location.port == 8181) {
                    var protocol = "http/2";
                } else {
                    var protocol = "http/1.1";
                }
                document.getElementById("result").innerHTML = protocol + "    &#x23f1; " + (page_load_time / 100) + " sec";
            };

            document.body.onkeyup = function (e) {
                if (e.keyCode == 32) {
                    //document.getElementById("pixtable").classList.toggle('image');
                    //document.getElementById("grid").classList
                    document.getElementById("pixtable").classList.toggle('grid');
                }
            }
